🚨NA PF🚨
1. O prefeito de Manaus, David Almeida, esteve na sede da PF, nesta sexta-feira;
2. Ele quer que seja investigada a disseminação de audio que tem circulado nas redes sociais e que ele aponta ter sido criado com inteligência artificial;
3. No audio de WhatsApp, atribuído ao prefeito, é dita a seguinte frase: “O que mais tem é professor vagabundo, que quer o dinheirinho de mão beijada. Eu não paguei o Fundeb, mas o povo esquece”.
4. David Almeida afirmou que não é ele quem fala e pede que os criadores do audio sejam encontrados. 

🎥 Fatos Marcantes Manaus

